import { Home } from "./home";
import { Dashboard } from "./dashboard";
import HomeIcon from "../../../public/SVG/icon_home.svg";
import DashboardIcon from "../../../public/SVG/icon_dashboard.svg";
export const Tabs = {
  home: { body: Home, displayName: "Home", icon: <HomeIcon /> },
  dashboard: {
    body: Dashboard,
    displayName: "Dashboard",
    icon: <DashboardIcon />,
  },
};
